<?phpnamespace Nemundo\App\ModelDesigner\Com\ListBox;use Nemundo\Admin\Com\ListBox\AdminListBox;use Nemundo\Model\Definition\Model\AbstractModel;class TypeListBox extends AdminListBox{    /**     * @var AbstractModel     */    public $model;    public function getContent()    {        $this->label = 'Type';        foreach ($this->model->getTypeList() as $type) {            $this->addItem($type->fieldName, $type->label);        }        return parent::getContent();    }}